import React from 'react';
import {Jumbotron} from 'reactstrap';

const Home = () => {
    return (
        <div>
            <Jumbotron>
                <h1>Deep Learning of react</h1>
                <p> 
                Developed by Shreyansh Gupta for basic understanding of react
                </p>
            </Jumbotron>
        </div>
    );
}

export default Home;
